import { Component } from '@angular/core';

@Component({
  selector: 'app-create-update-member',
  templateUrl: './create-update-member.component.html',
  styleUrls: ['./create-update-member.component.css']
})
export class CreateUpdateMemberComponent {
  firstName: string = '';
  lastName: string = '';
  fatherName: string = '';
  memberType: string = '';
  gender: string = '';
  dateOfBirth: string = '';
  maritalStatus: string = '';
  bloodGroup: string = '';
  education: string = '';
  permanentAddress: string = '';
  mobile: string = '';
  email: string = '';
  area: string = '';
  checkedSameAddress: boolean = false;
  currentAddress: string = '';
  proffession: string = '';
  proffessionAddress: string = '';
  proffessionEmail: string = '';
  proffessionNumber: string = '';
  checkIAffirm: string = '';

  onSave() {
    console.log("first name value :: "+this.firstName);
    console.log("first name value :: "+this.lastName);
  }
}
